import React from 'react'
import styled from "styled-components";


const Result = (props) => {

    return(
        <ResultStyle onClick={props.makePick} id={props.team}>
            {props.score}
        </ResultStyle>
    )
}


const ResultStyle = styled.div`
    width: 80px;
    background-color: #ADD8E6;
    padding: 10px 0;
`

export default Result;
